import React from 'react'
import "../Home.css"
import Homelogo from '../Homelogo'

import { FaUserFriends } from "react-icons/fa";
import { GrGroup } from "react-icons/gr";
import { FaFacebook } from "react-icons/fa";
import { BsFillBookmarksFill } from "react-icons/bs";
import { BsFillStopwatchFill } from "react-icons/bs";
import { MdEvent } from "react-icons/md";
import { GrTableAdd } from "react-icons/gr";
import { SiGoogleadsense } from "react-icons/si";
import { BiDonateBlood } from "react-icons/bi";
import { FaFacebookMessenger } from "react-icons/fa";
import { BiSave } from "react-icons/bi";
import { SiPagekit } from "react-icons/si";
import { BiUpArrowAlt } from "react-icons/bi";

function Home() {
    return (
        <div style={{height:'90vh',width:'100vw',display:'flex'}}>
            {/* body left side */}
    <div style={{backgroundColor:'rgb(228, 227, 225)',height:'90vh',width:'25vw',overflow:'auto'}}>

<div className="logos">

    <Homelogo Icon={    <div style={{height:'35px',width:'35px',backgroundColor:'red',borderRadius:'50px'}}></div>} tittle="Friend"/>
    <Homelogo Icon={FaUserFriends} tittle="Friend"/>

    <Homelogo Icon={GrGroup} tittle="Group"/>
    <Homelogo Icon={FaFacebook} tittle="Facebook"/>
    <Homelogo Icon={BsFillBookmarksFill} tittle="Bookmarks"/>
    <Homelogo Icon={BsFillStopwatchFill} tittle="Watch"/>
    <Homelogo Icon={MdEvent} tittle="Event"/>
    <Homelogo Icon={GrTableAdd} tittle="add"/>
    <Homelogo Icon={SiGoogleadsense} tittle="sense"/>
    <Homelogo Icon={BiDonateBlood} tittle="Blood"/>
    <Homelogo Icon={FaFacebookMessenger} tittle="Messenger"/>
    <Homelogo Icon={BiSave} tittle="Save"/>
    <Homelogo Icon={SiPagekit} tittle=""/>
    <Homelogo Icon={BiUpArrowAlt} tittle="Arrow"/>
   


</div>
    </div>

            {/* body middle side */}

    <div style={{backgroundColor:'red',height:'90vh',width:'58vw',}}></div>

            {/* body right side */}

    <div style={{backgroundColor:'aqua',height:'90vh',width:'25vw',}}></div>

        </div>
    )
}

export default Home
